parts.text:
Okay, I understand. I need to look for input fields related to space or charges, buttons to calculate or compute, and buttons to save. Then, I need to perform calculations based on the input fields and click the appropriate buttons. If I can't find the necessary elements or perform the calculations, I should return an error.
```json
[
  {"action": "check_selectors", "selectors": ["input[name*=space i], input[placeholder*=space i]", "input[name*=charge i]", "button:has-text(\"calculate\" i), button:has-text(\"compute\" i)", "button:has-text(\"save\" i)"]}
]
```
